import React from 'react'
import {Container} from './style'
import SimpleSlider from './SimpleSlider'
const Carusel = () => {
    return (
       <Container>
            <SimpleSlider  style={{widht:'500px'}}/>
       </Container>
    )
}

export default Carusel
